import React from 'react'
import { Link } from 'react-router-dom'

export const Header = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
     <a
                            type="button"
                            className="btn"
                            onClick={userLogout}
                          >
                            <i className="fas fa-sign-out-alt" /> Logout
                          </a>
      </nav>
  )
}
